import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <header>
      {/* Navigation links */}
      <nav>
        <Link to="/">Home</Link>
        <Link to="/login">Login</Link>
        {/* Add other links as needed */}
      </nav>
    </header>
  );
}

export default Header;
